    @Test
    public void testDetachOverlayJSON() throws Exception {
        ClassLoader classLoader = Thread.currentThread().getContextClassLoader();
        DicomInputStream din = null;
        DicomOutputStream dout = null;
        String json;
        try {
            din = new DicomInputStream(
                    new File(classLoader.getResource("IM-0008-0012-ORIGINAL.dcm").toURI()));
            /*dout = new DicomOutputStream(
                    new File("/home/miguel/IM-0008-0012-NOOVERLAY.dcm"));*/
            json = OverlayManagement.detachOverlayJSON(din, dout);
            System.out.println("json: " + json);
        }
        catch (IOException e) {
            e.printStackTrace();
            return;
        }
        finally {
            try {
                din.close();
                //dout.close();
            }
            catch (Exception e) {
                e.printStackTrace();
            }
        }
        assertEquals(testJson, json);
    }


